import {connect} from 'react-redux';

const mapStateToProps = state => ({
    appName: state.appName
})

class App extends React.Component {
    render(){
      return(
        <div>
          {this.props.appName}
        </div>
      )
    }
  }

export default connect(mapStateToProps, () => ({})) (App)
